    [],nt"num_tags": 3,nt"name": "migratory-bird-use-of-the-coastal-lagoon-system-of-the-beaufort-sea-coastline-within-the-a-19e44",nt"isopen":
    false,nt"url": null,nt"notes": "This report covers the migratory bird use
    of the coastal lagoon system of the Beaufort Sea coastline within the Arctic National
    Wildlife Refuge, Alaska. Aerial surveys were conducted on 10 selected coastal lagoons
    of Arctic National Wildlife Refuge during 1983 to obtain an index of relative numbers
    of migratory birds using the lagoon and to determine the relationship between three
    different survey techniques. Oldsquaw were identified as the major species using
    the lagoon (over 80% of the total population). The total number of oldsquaw observed
    in lagoons in 1983 approximated 1981 totals and exceeded 1982 numbers. Although
    the temporal distribution of oldsquaw observed was similar in all three years, the
    spatial relationships varied. As the season progressed, there appeared to be a westerly
    shift in oldsquaw use of lagoons. A shift from lagoon to offshore was, also, noted.
    Comparison of oldsquaw numbers and density observed in a 400m strip transect within
    the lagoon to the whole lagoon areas showed that the birds were, not randomly distributed
    and the strip transect cannot be used as an index of oldsquaw number or density
    in the entire lagoon. A three strip survey 'Has compared to the total lagoon survey,
    and revealed that the total lagoon survey remains the best estimate of oldsquaw
    numbers.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
